        <div
            style={{
                margin: "10px",
                padding: "10px",
                borderRadius: "5px",
                border: "1px solid teal"
            }}

        >
            <p>{id}</p>
            <p>Movie I.d: {movie_id}</p>
            <p>Name : {name}</p>
            <p>Seat : {seat}</p>
            <button onClick={handlecancelBooking}>CANCEL BOOKING</button>
        </div>
    );
}
